import React from 'react';
function List(){
    return (<ol>
    <li>Virat Kohli</li>
    <li>Adam Gilchrist</li>
    <li>Rohit Sharma</li>
    <li>Jaspreet Bumrah</li>
    <li>ABD Villiers</li>
</ol>)
}
export default List;
